import React, {forwardRef, ForwardedRef} from 'react'

export type Props = {}

const EmojiTradeMark = forwardRef((props: Props, ref: ForwardedRef<HTMLElement>) => {
  const { ...otherProps } = props

  return (
   <figure ref={ref} {...otherProps}>
      <img
        alt="Emoji-trade-mark"
        src="data:image/png;base64,&#x3D;&#x3D;"
      />
    </figure>
  )
})

EmojiTradeMark.displayName = 'EmojiTradeMark'
EmojiTradeMark.defaultProps = {}

export default EmojiTradeMark
